import React from 'react';
import {range, Vec2} from '../utility';

type GridProps = {position: Vec2};

const Grid: React.FC<GridProps> = (props) => {
    return (
        <div>
            {range(0, 10).map((row) =>
                range(0, 10).map((col) => {
                    if (row === 9)
                        <div>
                            {row}, {col}
                        </div>;
                }),
            )}
        </div>
    );
};

export default Grid;
